require("@/assets/css/style.min.css");
import axios from 'axios';
export default {
  name: 'About',
  data() {
    return {
      latestArticles: []
    };
  },
  components: {},
  mounted() {
    this.getLatestArticles();
  },
  methods: {
    async getLatestArticles() {
      await axios.get('/api/v1/latest-articles/').then(response => {
        this.latestArticles = response.data;
      }).catch(error => {
        console.log(error);
      });
    }
  }
};
